import ReactDOM from "react-dom";
import Heading from "./Heading";
import "./index.css";

ReactDOM.render(
  <>
    <ol>
    <Heading/>
      <li> Shreyas </li>
      <li> Anushka  </li>
      <li> Sumeet </li>
    </ol>
  </>,
  document.getElementById("root")
);
